import StoreButton from "./StoreButton";
const Base=()=>{

    return(
        <div>
            <div>
                <input type="text" defaultValue='0'/>
            </div>
            <div>
                {StoreButton.buttons.map(item=> <button>{item.num}</button>)}
            </div>
        </div>
    )
}

export default Base;
